package ra.dev.model.dto.request.orderDetail;import lombok.Data;import lombok.NoArgsConstructor;@Data@NoArgsConstructorpublic class OrderGetDetail {    private Integer detailId;    private Integer orderId;    private Integer price;    private String productName;    private Integer quantity;    private Integer totalAmount;    private String note;    private String productImage;    public OrderGetDetail(Integer detailId,                          Integer orderId,                          Integer price,                          String productName,                          Integer quantity,                          Integer totalAmount,                          String note,                          String productImage) {        this.detailId = detailId;        this.orderId = orderId;        this.price = price;        this.productName = productName;        this.quantity = quantity;        this.totalAmount = totalAmount;        this.note = note;        this.productImage = productImage;    }}